import React, {Component} from 'react';
import {
	HeaderWrapper,
	LogoPic,
	HeaderContainer,
	Additional
}from './style.js'

class Header extends Component {
	render() {
		return (
			<HeaderWrapper>
				<LogoPic />
				<HeaderContainer>
					<HeaderItem>首页</HeaderItem>
					<HeaderItem>首页</HeaderItem>
					<SearchBox placeholder='搜索' />
					<HeaderItem>首页</HeaderItem>
					<HeaderItem>首页</HeaderItem>
					<HeaderItem>首页</HeaderItem>
				</HeaderContainer>
				<Additional>
				</Additional>
			</HeaderWrapper>
		)
	}
}

export default Header;
